onfinish:
try{
       if(location.href.includes('api.cuevana3') && document.getElementsByClassName('link')[0] != undefined){
              location.replace(document.getElementsByClassName('link')[0].href);
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.includes('fembed/index.php')){
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.includes('index.php')){
              document.getElementsByTagName('form')[0].submit();
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.includes('api.cuevana3') && location.href.includes('fembed')){
              document.getElementById('player1').click();
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.includes('goto')){
              window.HTMLOUT.changeDoit(true);
       }else if(location.href.includes('tomate') ||
                     location.href.includes('streamtape') ||
                     location.href.includes('diasfem') ||
                     location.href.includes('waaw')){
              window.HTMLOUT.processHTML(location.href);
       }else{
              window.HTMLOUT.getError();
       }
}catch(error){
       window.HTMLOUT.getError();
}
